export const Review = (props) => {
    const { review } = props;
    return (
        <div>
            <div className="title">
                <h1>{review.title}</h1>
            </div>
            <div className="body">
                <p>{review.description}</p>
            </div>

            <div className="footer">
                <p>{review.username}</p>
            </div>
        </div>
    );
};
